{
  "openapi": "3.0.3",
  "components": {
    "schemas": {
      "graphedge": {
        "description": "Represents an edge from the dependency map.",
        "properties": {
          "acceptedFlows": {
            "description": "Number of accepted flows in the edge.",
            "type": "boolean"
          },
          "defaultAcceptedFlows": {
            "description": "The truth value that indicates if there are accepted default flows.",
            "type": "boolean"
          },
          "defaultRejectedFlows": {
            "description": "The truth value that indicates if there are rejected default flows.",
            "type": "boolean"
          },
          "destinationController": {
            "description": "Name of the remote destination controller if different than the current one.",
            "type": "string"
          },
          "destinationID": {
            "description": "ID of the destination `GraphNode` of the edge.",
            "type": "string"
          },
          "destinationType": {
            "description": "Type of the destination `GraphNode` of the edge.",
            "enum": [
              "ProcessingUnit",
              "ExternalNetwork",
              "Namespace",
              "Node",
              "RemoteController"
            ]
          },
          "details": {
            "additionalProperties": {
              "$ref": "./graphedgeflowdetails#/components/schemas/graphedgeflowdetails"
            },
            "description": "Contains more flow details grouped by their destination protocol/ports.",
            "type": "object"
          },
          "encrypted": {
            "description": "The number of encrypted flows in the edge.",
            "type": "boolean"
          },
          "firstSeen": {
            "description": "Contains the date when the edge was first seen.",
            "format": "date-time",
            "type": "string"
          },
          "flowID": {
            "description": "Identifier of the edge.",
            "type": "string"
          },
          "lastSeen": {
            "description": "Contains the date when the edge was last seen.",
            "format": "date-time",
            "type": "string"
          },
          "namespace": {
            "description": "Namespace of the object that reported the flow.",
            "type": "string"
          },
          "observedAcceptedFlows": {
            "description": "Number of accepted observed flows.",
            "type": "boolean"
          },
          "observedEncrypted": {
            "description": "Number of encrypted observed flows.",
            "type": "boolean"
          },
          "observedRejectedFlows": {
            "description": "Number of rejected observed flows.",
            "type": "boolean"
          },
          "rejectedFlows": {
            "description": "Number of rejected flows in the edge.",
            "type": "boolean"
          },
          "remoteNamespace": {
            "description": "Namespace of the object that was targeted by the flow.",
            "type": "string"
          },
          "sourceController": {
            "description": "Name of the remote source controller if different than the current one.",
            "type": "string"
          },
          "sourceID": {
            "description": "ID of the source `GraphNode` of the edge.",
            "type": "string"
          },
          "sourceType": {
            "description": "Type of the source `GraphNode` of the edge.",
            "enum": [
              "ProcessingUnit",
              "ExternalNetwork",
              "Namespace",
              "Node",
              "RemoteController"
            ]
          }
        },
        "type": "object"
      }
    }
  },
  "info": {
    "contact": {
      "email": "dev@aporeto.com",
      "name": "Aporeto Inc.",
      "url": "go.aporeto.io/api"
    },
    "license": {
      "name": "TODO"
    },
    "termsOfService": "https://localhost/TODO",
    "title": "graphedge",
    "version": "1.0"
  },
  "paths": {
    "/graphedges": {
      "get": {
        "description": "Retrieves the graph edges.",
        "operationId": "get-all-graphedges",
        "parameters": [
          {
            "description": "Set the absolute end of the time window.",
            "example": "2018/04/08 10:42",
            "in": "query",
            "name": "endAbsolute",
            "schema": {
              "format": "date-time",
              "type": "string"
            }
          },
          {
            "description": "Set the relative end of the time window.",
            "example": "-1h",
            "in": "query",
            "name": "endRelative",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "If set to true, each edge will contain a field called 'Details' which provides detailed information per protocol/port.",
            "in": "query",
            "name": "includeDetails",
            "schema": {
              "type": "boolean"
            }
          },
          {
            "description": "Filtering query. Consequent `q` parameters will form an or.",
            "example": "associatedTags contains ['$name=hello'] or type == 'Docker'",
            "in": "query",
            "name": "q",
            "schema": {
              "type": "string"
            }
          },
          {
            "description": "Set the absolute start of the time window.",
            "example": "2018/03/08 10:42",
            "in": "query",
            "name": "startAbsolute",
            "schema": {
              "format": "date-time",
              "type": "string"
            }
          },
          {
            "description": "Set the relative start of the time window.",
            "example": "-1h",
            "in": "query",
            "name": "startRelative",
            "schema": {
              "type": "string"
            }
          }
        ],
        "responses": {
          "200": {
            "content": {
              "application/json": {
                "schema": {
                  "items": {
                    "$ref": "#/components/schemas/graphedge"
                  },
                  "type": "array"
                }
              }
            },
            "description": "n/a"
          }
        },
        "tags": [
          "visualization/depmaps",
          "meteor"
        ]
      }
    }
  },
  "tags": [
    {
      "description": "This tag is for group 'visualization/depmaps'",
      "name": "visualization/depmaps"
    },
    {
      "description": "This tag is for package 'meteor'",
      "name": "meteor"
    }
  ]
}
